import '../style.css'
import '../components/Nav'
import Nav from "../components/Nav";

function Recovery() {
    <Nav></Nav>
    return (


        <div className={"container"}>
            {/*"form-box" handled in Style Sheet*/}
            <div className={"form-box"}>
                <h1>Recover Password</h1>
                <form>
                    <div className="input-group" id="forms">
                        {/*// <!--                Will i need to change the id of "email-field?-->*/}
                        <div className="input-field" id="email-field">
                            {/*// <!--                    Label for text readers (for partially sighted)-->*/}
                            <label htmlFor="email" hidden>Recover Email</label>
                            {/*// <!--                    Envelope icon for email fields-->*/}
                            <i className="fa-solid fa-envelope"></i>
                            <input id="email" name="email" placeholder="Email" type="email"></input>
                        </div>

                    </div>
                    <div className="invisible-text" id="recover-message">
                        <p>If an account exists an email to reset your password has been sent.</p>

                    </div>
                    <div className="button-field">
                        <button id="recover" name="recover" type="button">Send Email</button>
                    </div>

                </form>
            </div>
        </div>
    )
}

export default Recovery;
